def returnBool(flag):
    if flag == 0: return 'false'
    elif flag == 1: return 'true'
    else:
        a = round(random.randint(0, 10))
        #print(a)
        if a%2 == 0: return 'true'
        else : return 'false'

def returnString(alphabet, max, numbers, cap):
    a = 'abcdefghijklmnopqrstuvwxyz'
    b = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ'
    c = 'abcdefghijklmnopqrstuvwxyz1234567890'
    d = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ1234567890'
    
    # Se 'alphabet' nao for None, os parametros 'numbers' e 'cap'

    if alphabet == None:
        if numbers == 1 and cap == 1:
            alphabet = d
        elif numbers == 1:
            alphabet = c
        elif cap == 1:
            alphabet = b
        else: 
            alphabet = a
    
    ret = ''
    for x in range(0, max):
        k = random.randint(0, len(alphabet)-1)
        ret += alphabet[k]
    
    return ret

