#dates (ISO 8601) -> YYYY-MM-DDTHH:MM:SSSZ
#                    YYYY-MM-DDTHH:MM:SSS-UTC

def retDate():
    a = '201' + str(random.randint(5, 9)) + '-'
    b = random.randint(0,1)
    if b == 1: a += str(b) + str(random.randint(1, 2))
    else: a += str(b) + str(random.randint(1, 9))
    a += str(random.randint(0, 2)) + str(random.randint(1, 9)) + 'T'
    a += str(random.randint(0,1)) + str(random.randint(0,9)) + ':'
    a += str(random.randint(0,5)) + str(random.randint(0,9)) + ':'
    a += str(random.randint(0,5)) + str(random.randint(0,9)) + '0Z'
    return a

def retBirthday():
    a = '19' + str(random.randint(5, 9)) + str(random.randint(0, 9)) + '-'
    b = str(random.randint(0, 1))
    if b == 1: a += str(b) + str(random.randint(1, 2))
    else: a += str(b) + str(random.randint(1, 9))
    a += '-' + str(random.randint(0, 2)) + str(random.randint(1, 9))
    return a

