def createDoc1(n):
    file = '[\n'
    for x in range(0, n):
        person = retUser()
        date = retDate()
        id = random.randint(0,10000)
        invoiceid = date[0:4] + date[5:7] + date[8:10] + str(id) + str(x)

        file += '\t{\n'
        file += '\t\t"order":{\n'
        file += '\t\t\t"customer_id":' + str(id) + ',\n'
        file += '\t\t\t"customer_name":"' + str(person[0]) + '",\n'
        file += '\t\t\t"customer_phonenumber":' + str(person[2]) + ',\n'
        file += '\t\t\t"customer_address":"' + str(person[1]) + '",\n'
        file += '\t\t\t"invoice_id":' + str(x) + ',\n'
        file += '\t\t\t"invoice_date":"' + invoiceid + '",\n'
        file += '\t\t\t"delivery_address":"' + str(person[1]) + '",\n'
        file += '\t\t\t"invoice_items":[\n' 
        a = random.randint(1, 6)
        total = 0
        for i in range(0, a):
            prod = retProduct()
            qnt = random.randint(1, 3)
            total += (qnt * prod[2])
            file += '\t\t\t\t{\n'
            file += '\t\t\t\t\t"item_number":' + str(prod[0]) + ',\n'
            file += '\t\t\t\t\t"product_name":"' + prod[1] + '",\n'
            file += '\t\t\t\t\t"quantity":' + str(qnt) + ',\n'
            file += '\t\t\t\t\t"item_price":' + str(prod[2]) + '\n'
            file += '\t\t\t\t}' 
            if i < a - 1: file += ',\n'
        file += '\t\t\t],\n'
        file += '\t\t\t"total_amount":' + "{:.2f}".format(total) + '\n'
        file += '\t\t}\n'
        file += '\t}'
        if x < n - 1:file += ','
        file += '\n'
    file += ']'
    return file



